var userSecret = configuration['user.secret'];
var orgSecret = configuration['organization.secret'];

request_vendor_headers.Authorization = "User " + userSecret + ", Organization " + orgSecret;

done({
	"request_vendor_headers": request_vendor_headers,
  continue: true
})

var response = response_body;
var responseStatusCode = response_status_code;
if(responseStatusCode == 404) {
	var message = response.message;
  if(message == "No usage logs found") {
  	responseStatusCode = 200;
    response = [];
  }
} else {
	for (let i = 0; i < response.length; i++) {
  	response[i]['id'] = response[i]['request_id'];
  }
}
done({
	"response_status_code": responseStatusCode,
  "response_body": response
})

let parameters = request_vendor_parameters

if (request_expression) {
 	 for (let i = 0; i < request_expression.length; i++) {
   		if (request_expression[i].operator === ">" || request_expression[i].operator === ">=") {
       		parameters.from = request_expression[i].value; 
      } else {
        	parameters.to = request_expression[i].value;
      }	
   }
}

delete parameters.where
delete parameters.page
delete parameters.pageSize
delete parameters.pageOffset

done({
	request_vendor_parameters: parameters,
  continue: true
})

var response = response_body;
var id = response['request_id'];
response['id'] = id;

done({
	"response_body": response
})

var userSecret = configuration['user.secret'];
var orgSecret = configuration['organization.secret'];

request_vendor_headers.Authorization = "User " + userSecret + ", Organization " + orgSecret;

done({
	"request_vendor_headers": request_vendor_headers,
  continue: true
})
